import React from 'react';

const CreateServices = () => {
  return (
    <form>
        <div> Супер тип
            <div>Название: </div><input/>
            <div>Аннотация: </div><input/>
        </div>
        <div> Тип
            <div>Название: </div><input/>
            <div>Аннотация: </div><input/>
            <div>id супер типа: </div><input/>
        </div>
        <div> Услуга
            <div>Название: </div><input/>
            <div>Аннотация: </div><input/>
            <div>id типа: </div><input/>
            <div>цена: </div><input/>
        </div>      
    </form>
  );
};
export default CreateServices;
